 is a graph-independent strategy to simulate feature distribution shifts.
In OpenFGL, we utilize this approach to create more challenging and realistic scenarios for evaluating FGL algorithms.
Specifically, we implement the following feature operations:
(1) Adding Gaussian or Laplacian noise to introduce variability;
(2) Applying scaling operations to simulate different magnitudes of features;
(3) Employing mathematical transformations to further diversify the feature distributions.

